import { useState } from "react"
import React from 'react'

export default function Form() {
    const Copytxt = (event) => {
        console.log(event.target.value)
    }


    const [name, setName] = useState('')
    const Addtxt = (event) => {
        setName(event.target.value);
    }
    return (
        <>
            <div>
                <h1>This is a form</h1>
                <input type='text' onChange={Copytxt} className='form-control form-control-lg' placeholder='Enter name' />
                <br /><br />
                <button className='btn btn-primary btn-lg' onClick={Addtxt}>kjhiug</button>
            </div>
        </>
    )
}
